INSERT INTO `evento` VALUES (0,1,2,NULL,NULL,NULL,NULL,NULL,'A modalidade foi instituída oficialmente no pais em 31 de julho de 1897, data em que os clubes Botafogo, Gragoata, Icarai e Flamengo fundaram a União de Regatas Fluminense, na cidade do Rio de Janeiro, renomeado mais tarde como Conselho Superior de Regatas e, por fim, confederação brasileira de natação\nAs primeiras disputas ocorriam na Baía de Guanabara.\n\nPorém, antes disso, a primeira competição oficial que se tem registro é a travessia da Baía de Guanabara, no Rio de Janeiro. Ela ocorreu em uma disputa entre Joaquim Antonio Souza, de 19 anos, de Niterói, e um relojoeiro alemão Theodor John, de 50, no ano de 1881. A cada ano, os dois voltavam a disputar a prova, com cada vez mais pessoas, que aderiam à manifestação esportiva.[1]\n\nEm 1885, quatro anos depois do início das disputas, a primeira piscina brasileira foi construída às margens do rio Guaíba, em Porto Alegre, Rio Grande do Sul, a qual recebeu o nome de Badeanstalf, ou também basenho, pela Sociedade Ginástica Deutsher Turnverein.[1]\n\nO primeiro Campeonato Brasileiro, na modalidade 1500m nado livre, com o percurso da fortaleza Villegaignon até a praia de Santa Luzia, é disputado em 1898,[2] tendo como campeão Abrahão Saliture. A Federação, localizada em Botafogo, passa a divulgar o Campeonato Brasileiro em 1913, ano em que são disputadas as provas de 100m para estreantes, 600m para seniores e 200m para juniores. Em 1914, o controle do esporte e as competições em território brasileiro passam para a Confederação Brasileira de Desportos.[3]\n\nEm 1 de outubro de 1904, é disputado o primeiro interestadual de natação que se tem notícia. O Clube Espéria, de São Paulo, organizou uma festa desportiva onde possuía uma raia de 350 metros de distância. Abrahão Saliture, competindo pelo Clube de Natação e Regatas, do Rio de Janeiro, acabou como campeão.[4]\n\nUm ano depois, em 1905, iniciaram-se as competições de natação do rio Tietê, em comemoração do aniversário do Espéria, evento que se repetiria até os anos 1920. Entre as disputas de remo, provas de 100 e 350 metros eram travadas. Os grandes destaques dos anos que antecederam a Primeira Guerra Mundial eram Guilherme Schollz, Walter von Kutzleben e José Rubião, mas esses não eram páreo para Saliture, que comparecia como convidado e jamais foi superado. Saliture chegou a participar dos Jogos Olímpicos de 1920, na Antuérpia.[4] ',1,NULL,NULL,'2019-05-16 00:53:56',NULL,1),(1,1,1,NULL,NULL,NULL,NULL,NULL,'MENSAGEM DO PRESIDENTE\r\n\r\nQuando tomei a decisão de me candidatar ao cargo de presidente da Confederação Brasileira de Basketball, sabia que teria muitos desafios, que nossa equipe precisaria de muita dedicação para recolocar o basquetebol brasileiro no merecido local de destaque no cenário mundial, mas sabia, também, da importância não apenas de buscar novas conquistas, mas de valorizar as glórias dos “heróis” que trouxeram tantas alegrias aos amantes do nosso esporte. Homens e mulheres que, por amor ao basquetebol, se dedicaram, superaram dificuldades, venceram adversários em partidas onde nossos atletas eram “Davi” diante de “Golias”. \r\nEu, que sou ex-atleta, e também faço parte dessa história, hoje, ocupando a função de Presidente da entidade máxima do basquetebol nacional, considero-me na obrigação de fazer esse reconhecimento trazendo aos amantes do esporte um pouco dessa história, que será contada através de imagens.\r\nTerei eternamente orgulho de ter ocorrido na minha gestão à frente da CBB a realização da parceria com a conceituada Universidade do Estado do Rio de Janeiro – UERJ, para a construção do E-MUSEU, o Museu Nacional do Esporte, onde faz parte o Museu do Basquetebol.\r\nAproveito a oportunidade para parabenizar atletas, membros de comissão técnica, dirigentes e todos os envolvidos, dentro e fora das quadras, que fazem parte da história do basquetebol nacional, que nos deu tanta alegria e emoção.\r\nA importância deste trabalho se traduz na citação de Cícero:\r\n “A história é testemunha do passado, luz da verdade, vida da memória, mestra da vida, anunciadora dos tempos antigos”.\r\nPor fim, agradeço à Universidade do Estado do Rio de Janeiro – UERJ pela parceria e o incansável esforço na construção desse projeto. Desejamos caminhar juntos no crescimento do E-MUSEU, fomentando o aumento de seu acervo e engrandecendo a memória do esporte nacional. \r\n\r\nGuy Rodrigues Peixoto Junior.',1,NULL,NULL,'2019-04-08 15:10:16',NULL,1),(2,2,1,NULL,NULL,NULL,'1994',NULL,'TESTE',1,NULL,NULL,'2019-04-26 04:19:06',NULL,0),(3,2,1,NULL,NULL,NULL,'1948 - Jogos Olímpicos de Londres',NULL,'A Seleção Masculina conquista a medalha de Bronze.',1,NULL,NULL,'2019-04-26 13:19:35',NULL,0),(4,2,1,NULL,2200,NULL,'1959 - Mundial Masculino do Chile',NULL,'O Basquete Brasileiro ganha seu primeiro título mundial.',1,NULL,NULL,'2019-04-26 13:22:03',NULL,1),(5,2,1,NULL,2221,NULL,'1960 - Jogos Olímpicos de Roma',NULL,'A Seleção Brasileira Masculina conquista a medalha de Bronze.',1,NULL,NULL,'2019-04-26 13:32:41',NULL,1),(6,2,1,NULL,2227,NULL,'1964 - Jogos Olímpicos de Tóquio',NULL,'A Seleção Masculina conquista a medalha de Bronze.',1,NULL,NULL,'2019-04-26 13:38:39',NULL,1),(7,2,1,NULL,62,NULL,'1970 - Mundial Masculino da Iugoslávia',NULL,'O Brasil conquista a medalha de Prata.',1,NULL,NULL,'2019-04-26 13:41:56',NULL,1),(8,2,1,NULL,2251,NULL,'1994 - Campeonato Mundial Feminino da Austrália',NULL,'A Seleção Brasileira conquista a medalha de Ouro.',1,NULL,NULL,'2019-04-26 14:58:33',NULL,1),(9,2,1,NULL,NULL,NULL,'teste',NULL,'',1,NULL,NULL,'2019-04-26 15:04:50',NULL,0),(10,2,1,NULL,NULL,NULL,'teste2',NULL,'',1,NULL,NULL,'2019-04-26 15:10:09',NULL,0),(11,2,1,NULL,NULL,NULL,'teste4',NULL,'',1,NULL,NULL,'2019-04-26 15:12:53',NULL,0),(12,2,1,NULL,2237,NULL,'1971 - Mundial Feminino do Brasil',NULL,'A Seleção Brasileira conquistou a medalha de Bronze. Esta edição do campeonato foi realizada na cidade de São Paulo.',1,NULL,NULL,'2019-04-26 15:44:05',NULL,1),(13,2,1,NULL,NULL,NULL,'1987',NULL,'',1,NULL,NULL,'2019-04-26 15:46:11',NULL,0),(14,2,1,NULL,NULL,NULL,'1991',NULL,'',1,NULL,NULL,'2019-04-26 15:48:23',NULL,0),(15,2,1,NULL,NULL,NULL,'1996',NULL,'FOTO EXCLUÍDA POIS JÁ EXISTE OUTRO PRÊMIO 1996',1,NULL,NULL,'2019-04-26 16:16:30',NULL,0),(16,2,1,NULL,2256,NULL,'1999 - Jogos Pan-Americanos de Winnipeg',NULL,'A Seleção Masculina conquista a medalha de Ouro.',1,NULL,NULL,'2019-04-26 16:17:41',NULL,1),(17,2,1,NULL,82,NULL,'2000 - Jogos Olímpicos de Sydney',NULL,'A Seleção Brasileira Feminina conquista a medalha de Bronze.',1,NULL,NULL,'2019-04-26 16:18:52',NULL,1),(18,2,1,NULL,2191,NULL,'1939 - Campeonato Sul-Americano do Brasil',NULL,'A Seleção Masculina conquista o título do 7° Campeonato Sul-Americano. Esta competição foi realizada na cidade do Rio de Janeiro.',1,NULL,NULL,'2019-04-27 18:51:07',NULL,1),(19,2,1,NULL,NULL,NULL,'CBB',NULL,'Historia',1,NULL,NULL,'2019-05-13 19:02:52',NULL,0),(20,2,1,NULL,NULL,NULL,'1957 - Campeonato Mundial Fem 1957',NULL,'Historia',1,NULL,NULL,'2019-05-13 19:42:47',NULL,0),(21,2,1,NULL,NULL,NULL,'1954 - Campeonato Mundial Masc 1954',NULL,'historia',1,NULL,NULL,'2019-05-13 19:43:46',NULL,0),(22,2,1,NULL,190,NULL,'1954 - Campeonato Sul-Americano Feminino do Brasil',NULL,'Primeiro Título Sul-Americano Feminino. Competição realizada na cidade de São Paulo.',1,NULL,NULL,'2019-05-13 19:44:41',NULL,1),(23,2,1,NULL,NULL,NULL,'Prêmio Excluido',NULL,'Já existe outro premio 1939. Tirei as fotos de 1938 e 1942',1,NULL,NULL,'2019-05-13 19:45:34',NULL,0),(24,2,1,NULL,962,NULL,'CBB 70 anos',NULL,'Em 2003 foi realizada a comemoração dos 70 anos da Confederação Brasileira de Basketball.',1,NULL,NULL,'2019-05-13 19:47:16',NULL,1),(25,2,1,NULL,NULL,NULL,'1997 - Copa America de Basquetebol Feminino',NULL,'Historia',1,NULL,NULL,'2019-05-13 19:57:03',NULL,0),(26,2,1,NULL,849,NULL,'Diplomas',NULL,'Diplomas recebidos por participação e conquistas em competições.',1,NULL,NULL,'2019-05-13 19:59:29',NUL