como convidado e jamais foi superado. Saliture chegou a participar dos Jogos Olímpicos de 1920, na Antuérpia.[4]',1,NULL,NULL,'2019-05-16 00:53:56',NULL,1),(40,1,2,NULL,NULL,NULL,NULL,NULL,'A modalidade foi instituída oficialmente no pais em 31 de julho de 1897, data em que os clubes Botafogo, Gragoata, Icarai e Flamengo fundaram a União de Regatas Fluminense, na cidade do Rio de Janeiro, renomeado mais tarde como Conselho Superior de Regatas e, por fim, confederação brasileira de natação\r\nAs primeiras disputas ocorriam na Baía de Guanabara.\r\n\r\nPorém, antes disso, a primeira competição oficial que se tem registro é a travessia da Baía de Guanabara, no Rio de Janeiro. Ela ocorreu em uma disputa entre Joaquim Antonio Souza, de 19 anos, de Niterói, e um relojoeiro alemão Theodor John, de 50, no ano de 1881. A cada ano, os dois voltavam a disputar a prova, com cada vez mais pessoas, que aderiam à manifestação esportiva.[1]\r\n\r\nEm 1885, quatro anos depois do início das disputas, a primeira piscina brasileira foi construída às margens do rio Guaíba, em Porto Alegre, Rio Grande do Sul, a qual recebeu o nome de Badeanstalf, ou também basenho, pela Sociedade Ginástica Deutsher Turnverein.[1]\r\n\r\nO primeiro Campeonato Brasileiro, na modalidade 1500m nado livre, com o percurso da fortaleza Villegaignon até a praia de Santa Luzia, é disputado em 1898,[2] tendo como campeão Abrahão Saliture. A Federação, localizada em Botafogo, passa a divulgar o Campeonato Brasileiro em 1913, ano em que são disputadas as provas de 100m para estreantes, 600m para seniores e 200m para juniores. Em 1914, o controle do esporte e as competições em território brasileiro passam para a Confederação Brasileira de Desportos.[3]\r\n\r\nEm 1 de outubro de 1904, é disputado o primeiro interestadual de natação que se tem notícia. O Clube Espéria, de São Paulo, organizou uma festa desportiva onde possuía uma raia de 350 metros de distância. Abrahão Saliture, competindo pelo Clube de Natação e Regatas, do Rio de Janeiro, acabou como campeão.[4]\r\n\r\nUm ano depois, em 1905, iniciaram-se as competições de natação do rio Tietê, em comemoração do aniversário do Espéria, evento que se repetiria até os anos 1920. Entre as disputas de remo, provas de 100 e 350 metros eram travadas. Os grandes destaques dos anos que antecederam a Primeira Guerra Mundial eram Guilherme Schollz, Walter von Kutzleben e José Rubião, mas esses não eram páreo para Saliture, que comparecia como convidado e jamais foi superado. Saliture chegou a participar dos Jogos Olímpicos de 1920, na Antuérpia.[4]',1,NULL,NULL,'2019-05-16 00:53:56',NULL,1),(41,1,3,NULL,NULL,NULL,'Biografia usuario marialenk@cbda.org.br','Biografia do perfil criado para Maria Lenk','Maria Emma Hulda Lenk Zigler nadava desde os primeiros anos da introdução das competições no Brasil, participando das provas ainda em mar aberto.[1]\n\nTudo começa com uma pneumonia dupla. Depois do susto, os pais acharam que a natação faria bem à saúde da filha de dez anos. Na ausência de piscinas, a paulistana Maria Lenk teve de dar suas primeiras braçadas no rio Tietê. Em 1925, o rio não era poluído e era possível banho recreativo e a prática de esportes.[1]\n\nDe 1932 a 1935, venceu 4 vezes seguidas a tradicional Travessia de São Paulo a Nado[3].\n\nAos dezessete anos já era uma atleta de nível internacional. Foi a primeira mulher sul-americana a competir em Jogos Olímpicos, nos Jogos de Los Angeles, em 1932.[1]\n\nMaria, junto com outros 68 atletas da equipe brasileira, custearam a viagem para competir nos Jogos Olímpicos de Los Angeles, vendendo o café que levaram no porão do navio.[1] \"O que valia era o conceito do amadorismo. Eu competi com um uniforme emprestado, que tive de devolver quando as provas acabaram\", lembra.\n\nNão conseguiu ganhar medalhas em Jogos Olímpicos, mas é considerada pioneira da natação moderna, e foi a responsável pela introdução do nado borboleta, quando o nadou nos Jogos Olímpicos de Verão de 1936 em Berlin, em uma prova de peito. Nessa edição dos Jogos, estava acompanhada por mais três nadadoras. [1]\n\nEm  1939, durante a preparação para os Jogos Olímpicos de Tóquio, que foram cancelados, quebrou dois recordes mundiais individuais, nos 200m e 400m peito, a primeira e única brasileira a fazê-lo.[1]\n\nO recorde dos 400 metros nado peito, [que atualmente não existe mais] 6min15s80, foi registrado no dia 11 de outubro daquele ano, na piscina do Clube de Regatas Guanabara. No mês seguinte, Lenk nadou 2min56s90 na prova de 200 peito, também na piscina do Guanabara.[1]\n\nOs planos para os Jogos Olímpicos de 1940 tiveram de ser interrompidos por ocasião da Segunda Guerra Mundial, gerando uma grande decepção.[1]\n\nEla era a grande favorita a ganhar a primeira medalha de ouro olímpica de mulheres brasileiras em esportes individuais. Tal feito só foi realizado 68 anos depois, pela saltadora Maurren Maggi, nos Jogos Olímpicos de Pequim.[1]\n\nNo início dos anos 40, foi a única mulher da delegação de nadadores sul-americanos que excursionou pelos Estados Unidos. Maria Lenk quebrou doze recordes norte-americanos e aproveitou sua estadia para concluir o curso de Educação Física na Universidade de Illinois em Springfield.[1]\n\nEm 1942 ajudou a fundar a Escola Nacional de Educação Física da Universidade do Brasil, atual Universidade Federal do Rio de Janeiro. Era também membro vitalício da Sociedade Americana de Técnicos de Natação.[1]\n\nAinda hoje detém diversos recordes mundiais de masters, entrando para o Hall da Fama da Federação Internacional de Natação (FINA) em 1988, quando foi homenageada com o Top Ten da entidade máxima do esporte por ser um dos dez melhores nadadores master do mundo.[1]\n\nNo campeonato mundial da categoria 85-90 anos, realizado em agosto de 2000, ela voltou de Munique com cinco medalhas de ouro: foi a campeã dos 100 metros peito, 200 metros livre, 200 metros costas, 200 metros medley e 400 metros livre.[1] Nesse torneio, ela ganhou o apelido de Mark Spitz da terceira idade, uma referência às sete medalhas de ouro que o nadador norte-americano ganhou nos Jogos Olímpicos de Verão de 1972 em Munique.[1]\n\nEm 2003, após três anos de pesquisas, lançou o livro Longevidade e Esporte, onde mostrou os benefícios trazidos pela prática de esportes. Até os últimos dias de vida nadava cerca de 1.500 metros por dia.[1]',1,NULL,NULL,'2019-05-18 20:33:59',NULL,1),(42,2,3,NULL,809,NULL,'Coleção Histórica',NULL,'Em 2003, após três anos de pesquisas, lançou o livro Longevidade e Esporte, onde mostrou os benefícios trazidos pela prática de esportes. Até os últimos dias de vida nadava cerca de 1.500 metros por dia.[1]',1,NULL,NULL,'2019-05-18 21:52:09',NULL,1),(43,2,1,NULL,NULL,NULL,'CBB2',NULL,'Historia',1,NULL,NULL,'2019-05-20 13:38:38',NULL,0),(44,2,1,NULL,NULL,NULL,'Fichas de Atletas ',NULL,'Fichas',1,NULL,NULL,'2019-05-20 14:14:05',NULL,0),(45,2,1,NULL,NULL,NULL,'CBB3',NULL,'Historia',1,NULL,NULL,'2019-05-20 16:21:10',NULL,0),(46,2,1,NULL,NULL,NULL,'CBB ',NULL,'historia (ESCONDER ESSA PASTA)',1,NULL,NULL,'2019-05-20 17:06:13',NULL,0),(47,2,1,NULL,NULL,NULL,'Raridades',NULL,'OCULTAR ESSE PRÊMIO',1,NULL,NULL,'2019-05-20 18:43:44',NULL,0),(48,2,1,NULL,1624,NULL,'1957 - Campeonato Mundial Feminino do Brasil.',NULL,'A Seleção Brasileira ficou na quarta colocação. Competição realizada na cidade do Rio de Janeiro',1,NULL,NULL,'2019-05-20 19:20:00',NULL,1),(49,2,1,NULL,2204,NULL,'1954 - Campeonato Mundial Masculino do Brasil',NULL,'A Seleção Brasileira conquista a medalha de Prata.',1,NULL,NULL,'2019-05-20 19:27:46',NULL,1),(50,2,1,NULL,NULL,NULL,'4o campeonato mundial basquete masc_1963',NULL,'historia',1,NULL,NULL,'2019-05-20 19:39:12',NULL,0),(51,2,1,NULL,NULL,NULL,'4o campeonato mundial basquete masc_1963',NULL,'historia',1,NULL,NULL,'2019-05-20 19:46:11',NULL,0),(52,2,1,NULL,NULL,NULL,'4º Campeonato Mundial Basquete Masc 1963',NULL,'Historia',1,NULL,NULL,'2019-05-20 20:02:12',NULL,0),(53,2,1,NULL,NULL,NULL,'1954 - 5° Campeonato